-- ----------------------------
-- Procedure structure for hsjProc
-- ----------------------------
DROP PROCEDURE IF EXISTS `hsjProc`;
delimiter ;;
CREATE PROCEDURE `hsjProc`(IN `strs_` varchar(255))
BEGIN 
    DECLARE i Int ;                      #申明变量
    SET i = 50;                          #变量赋值
    WHILE i <= 120 
		 DO                     #结束循环的条件: 当i大于10时跳出while循环
        Call `insertProc`(i,strs_);
        SET i = i + 10;                  #循环一次,i加一
    END WHILE; 
 END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for insertProc
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertProc`;
delimiter ;;
CREATE PROCEDURE `insertProc`(IN `attrib_` int,IN `strs_` varchar(255))
BEGIN 
    SET @array_content=REPLACE(strs_,' ',''); 
    SET @i=1; 
    SET @count=CHAR_LENGTH(@array_content)-CHAR_LENGTH(REPLACE(@array_content,',','')) + 1; 
    -- 得出数组成员总数 
    WHILE @i <= @count 
    DO 
    -- 依次插入每个成员  
    SET @i=@i+1; 
    END WHILE;
    END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
