INSERT INTO `npc_dialogue` VALUES (288, '强盗', 6201, 1, '此路是我开，此树是我栽，要想从此过……', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:23', '2019-07-15 22:01:23', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (289, '傅天涯阁', 6001, 1, '停，停，停，这台词实在是太老土啦！出来打劫也要与时俱进的好吗。#69m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:23', '2019-07-15 22:01:23', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (290, '强盗', 6201, 1, '敢拿你爷爷我开玩笑，我现在不仅要劫财，还要劫色！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:23', '2019-07-15 22:01:23', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (291, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (292, '强盗同伙', 6201, 1, '老大也太不中用了吧，打不过就丢下我们就跑了！看来只有使出绝招了！！我也跑！！！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (293, '傅天涯阁', 6001, 1, '哼，就这三脚猫功夫也敢来打劫，算你跑得快，这次就饶了你吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (294, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (295, '傅天涯阁', 6001, 1, '啊！包裹包裹呢？！#63m莲花姑娘托付的包裹不见了？！该死，定是被那盗贼给顺手牵去了！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (296, '傅天涯阁', 6001, 1, '叫我逮到绝对要给他好看！！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (297, '傅天涯阁', 6001, 1, '#B（那厮好像往#n#R卧龙坡#n#B逃去了，先去那里打听一番。）#n', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (298, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (299, '傅天涯阁', 6001, 1, '#B（该死的强盗，溜的都没影了，还是找人问问吧。）#n老前辈，方才是否看见一群强盗从这里经过？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (300, '玄武', 6191, 1, '小友这么急急忙忙的追一群强盗，可是丢了什么东西？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (301, '傅天涯阁', 6001, 1, '那群强盗偷走了友人托付我的包裹，所以甚是着急，前辈可曾看见他们？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (302, '玄武', 6191, 1, '可惜未曾发现，不过你可以去问问#Y神龙真人#n，他站的高远，也能看的更清楚一些。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (303, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (304, '傅天涯阁', 6001, 1, '神龙真人前辈，你站的高看得远，有没有看到一伙强盗经过？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (305, '神龙真人', 6042, 1, '看是没看到，不过据我所知山脚下有一伙强盗已盘踞多时，经常为害乡里，劫掠钱财。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (306, '傅天涯阁', 6001, 1, '#B（看这前辈仙风道骨，八成是修道之人吧。）#n前辈既然知道强盗横行，为何不出手制止呢？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (307, '神龙真人', 6042, 1, '劝人向善亦须点到即止，况且他们又非大恶，何必拘束其行径要其性命，除恶有时也是杀生，天道有轮回，善恶终有报。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (308, '傅天涯阁', 6001, 1, '我明白了！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (309, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (310, '强盗', 6201, 1, '居然追到爷爷的老窝来了！不就是说了个劫色么，至于么！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (311, '傅天涯阁', 6001, 1, '可恶的小贼！快把偷的包裹交出来。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (312, '强盗', 6201, 1, '什么包裹！什么偷！咱们可向来是明抢！从不干那小偷小摸的事儿！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (313, '傅天涯阁', 6001, 1, '不给你点颜色瞧瞧看来你是不会说实话了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (314, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (315, '强盗', 6201, 1, '好汉饶命啊！！我们真没见什么包裹啊，那片野狗颇多，绝对，绝对是被它们叼走了啊！#78m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (316, '傅天涯阁', 6001, 1, '#B（这强盗看起来倒不像说谎，时候也不早了还是赶紧找包裹要紧。）#n哼，算你老实，以后再敢作恶，看我不收拾你！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (317, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (318, '傅天涯阁', 6001, 1, '咦，这不就是莲花姑娘的那个包裹皮？里面的东西呢！？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (319, '傅天涯阁', 6001, 1, '前方好像有狗吠，那可恶的野狗肯定就在前面。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (320, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (321, '傅天涯阁', 6001, 1, '哈！好大一只恶犬！莲花姑娘的点心都让你糟蹋了！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (322, '野狗', 6104, 1, '汪汪汪！！！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (323, '小奶狗', 6177, 1, '呜呜呜……', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (324, '傅天涯阁', 6001, 1, '原来这大狗还要哺喂幼犬，罢罢罢，都怪我自己疏忽了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (325, '傅天涯阁', 6001, 1, '还好路上带了一些干粮，将它们装在包裹里捎给杨镖头吧。重要的是莲花姑娘的情意。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (326, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (327, '傅天涯阁', 6001, 1, '#R天墉城#n果然气派。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (328, '傅天涯阁', 6001, 1, '赶紧先把#Y莲花姑娘#n托付的包裹交给#Y杨镖头#n，再赶往#R五龙山云霄洞#n吧！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (329, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (330, '傅天涯阁', 6001, 1, '杨镖头，这是揽仙镇的莲花姑娘托我送予你的包裹。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (331, '杨镖头', 6033, 1, '我那日向莲花姑娘表明心意，她说若给我送来桃花糕，就是答应我了！你说这里面会是么？好紧张！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (332, '傅天涯阁', 6001, 1, '#B（啊？！糟糕！！被野狗吃掉的正是桃花糕！）#n杨镖头，杨镖头！你先别打开，别别别！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (333, '杨镖头', 6033, 1, '啊！是馒头！#45m我就说她怎么会看上我这粗俗的武夫。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (334, '傅天涯阁', 6001, 1, '杨镖头！杨大哥！这里面其实是桃花糕的，被我弄丢了而已，莲花姑娘她是心仪你的！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (335, '杨镖头', 6033, 1, '算了，你不用安慰我了。你走吧，让我一个人静静。#14m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (336, '傅天涯阁', 6001, 1, '#B（杨镖头沉浸在伤心中，一直不肯听解释！！！算了，以后有机会定要好好弥补这个错误！）#n', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (337, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (338, '傅天涯阁', 6001, 1, '#R五龙山云霄洞#n果然有仙道大家气象，若能在此修行，定能得证大道！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (339, '傅天涯阁', 6001, 1, '还是先进去看看再说吧，不知道人家愿不愿意收我为徒呢。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (340, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (341, '傅天涯阁', 6001, 1, '久慕贵门派盛名，欲拜入门下研习道法，不知可否？', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (342, '云霄童子', 6020, 1, '你运气不错，正逢我门广收门徒。不过这收与不收，还需看你资质如何。我且问你，何为道心？', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (343, '傅天涯阁', 6001, 1, '大道无穷，诸般虚实，唯秉本心。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (344, '云霄童子', 6020, 1, '不过夸夸奇谈，市井小民皆会这一套，我再问你，大道为何，虚实为何，本心又为何。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (345, '傅天涯阁', 6001, 1, '诸天神佛，皆乘大道，故大道不定。三界五行，皆有虚实，故虚实难分，道法自然，道心本心，故本心难测。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (346, '云霄童子', 6020, 1, '好，确有几分见解。我观你根骨尚佳，乃可塑之才，从今往后你就是我门三代弟子了。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (347, '云霄童子', 6020, 1, '既入我山门，自然也该习我道法，你先下去准备准备，一切妥当再来找我。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (348, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (349, '云霄童子', 6020, 1, '我欲授你本门道法玄妙，不过在这之前你需要先了解一下不同的战斗偏向，它将极大的影响你未来的前景！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (350, '傅天涯阁', 6001, 1, '还请师父说来。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (351, '云霄童子', 6020, 1, '不同的战斗偏向会带来效果自然不同。#R物理攻击#n如猛虎下山，重力重势。#R法术攻击#n如蛟龙布雨，重意重形。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (352, '云霄童子', 6020, 1, '当然，两种攻击手段各有千秋却殊途同归，皆是破敌制胜的手段。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (353, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (354, '云霄童子', 6020, 1, '既然你选择了物理攻击偏向，那么接下来你按照我的指点学习#R力破千钧#n。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (355, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (356, '云霄童子', 6020, 1, '很好，你已经成功掌握了学习技能的方法。随着你等级的提高，你还可以随时在#R角色技能#n界面学习新的技能。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (357, '云霄童子', 6020, 1, '除了技能等级以外#R属性点#n与#R相性点#n同样会左右技能伤害，你目前道行尚浅，贪多嚼不烂，待你日后道法精进，自会明白的。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (358, '傅天涯阁', 6001, 1, '弟子明白了。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (359, '云霄童子', 6020, 1, '接下来你在战斗中试试本门道法的威力吧。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (360, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (361, '云霄童子', 6020, 1, '不错，还是很有天赋嘛。现在正好有一件要紧之事交给你。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (362, '云霄童子', 6020, 1, '山中发现一走失的孩子，现命你将其送回家去，一路上你且好生照顾，莫要损了门派的声誉！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15574');
INSERT INTO `npc_dialogue` VALUES (363, '傅天涯阁', 6001, 1, '弟子定不辱使命！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (364, '走失的孩子', 6018, 1, '大哥哥，你趴下给我当大马骑好不好。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (365, '傅天涯阁', 6001, 1, '#B（这要被同门看见，脸可要丢光咯。）#n小朋友，大马不好玩，我带你去#R天墉城#n街上看杂耍，可有意思了！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (366, '走失的孩子', 6018, 1, '杂耍？那我们快去吧！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (367, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (368, '走失的孩子', 6018, 1, '大哥哥，我饿了，我要去吃大烧鸡！！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (369, '傅天涯阁', 6001, 1, '#B（你把我吃了算了！）#n烧鸡有什么好吃的，我知道有家包子才是人间美味。', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (370, '走失的孩子', 6018, 1, '真的？！那我们就去吃包子吧！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (371, '傅天涯阁', 6001, 1, '小孩子就是好骗。#56m', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (372, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (373, '走失的孩子', 6018, 1, '我才不吃素馅的，我要吃肉的，最好吃的那种！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (374, '冯喜来', 6016, 1, '好的嘞，客官请稍等！香喷喷的包子马上就来！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '15904');
INSERT INTO `npc_dialogue` VALUES (375, '走失的孩子', 6018, 1, '#B（这孩子拿起包子啃了一口，撇撇嘴就丢给了你。）#n我吃不下了，这些都给你吧！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (376, '傅天涯阁', 6001, 1, '小祖宗……#15m', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (377, '走失的孩子', 6018, 1, '你吃快点嘛，我先去河边玩会啦！', 0, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '20631');
INSERT INTO `npc_dialogue` VALUES (378, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—拜入师门', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '198687');
INSERT INTO `npc_dialogue` VALUES (379, '莲花姑娘', 6019, 1, '道长外出云游，有一事托我转告：你心性纯良，有修道之资，若能勤加修炼，定会大有作为。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (380, '傅天涯阁', 6001, 1, '道长真是有心了，奈何我拜师无门，又瞧不得那些旁门左道，不知何处去。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (381, '莲花姑娘', 6019, 1, '道长说了，最近五大门派正广招弟子，若是能拜入#R五龙山云霄洞#n门下就再好不过了，修行定会事半功倍。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (382, '傅天涯阁', 6001, 1, '我也听说#R五龙山云霄洞#n道法了得，此去定不负道长期望。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (383, '莲花姑娘', 6019, 1, '公子此行必定会经过天墉城吧，小女子正好有一物想托你捎给#R天墉城#n的……杨……杨镖头。#17f', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (384, '傅天涯阁', 6001, 1, '哈哈！放心交给我吧！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (385, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (386, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (387, '多闻道人', 6010, 1, '举手之劳罢了，你我相遇既是天意，也是对我道心的砺炼，我怎能见死不救，况且你还颇像我一位故人……', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (388, '傅天涯阁', 6001, 1, '#B（你观着道人面色和善，不免也心生亲切）#n若是有朝一日我能像道长一样修行道法，降妖除魔，那该多好。#3m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (389, '多闻道人', 6010, 1, '哈哈哈，我一山野道人，有什么好羡慕的。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (390, '傅天涯阁', 6001, 1, '我羡修道之人不畏浮云障目，不畏繁世扰心，修身证道，以求自在逍遥。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (391, '多闻道人', 6010, 1, '小友能感悟此道，将来定大有作为啊，不过你伤势刚刚痊愈，身体还很虚弱，不妨先去#Y王老板#n那取一副药服下，四处走走散散心吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (392, '多闻道人', 6010, 1, '老道这正好有把兵器，你且拿去以做防身之用吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (393, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (394, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
