INSERT INTO `npc_dialogue` VALUES (399, '多闻道人', 6010, 1, '小友能感悟此道，将来定大有作为啊，不过你伤势刚刚痊愈，身体还很虚弱，不妨先去#Y王老板#n那取一副药服下，四处走走散散心吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (400, '多闻道人', 6010, 1, '老道这正好有把兵器，你且拿去以做防身之用吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (401, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (402, '傅天涯阁', 6001, 1, '哇，你养了这么多小动物啊。#24m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (403, '黄仨儿', 6018, 1, '大哥哥，它们可不是一般的小动物，是可以用来战斗的宠物，你喜欢就送你一只吧。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (404, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (405, '傅天涯阁', 6001, 1, '这么小的动物，也能战斗？#32m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (406, '黄仨儿', 6018, 1, '就知道你不信，快来试试与宠物一起战斗吧！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (407, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (408, '黄仨儿', 6018, 1, '不错不错，你一下就学会了和宠物一起战斗。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (409, '傅天涯阁', 6001, 1, '呼！还真厉害。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (410, '黄仨儿', 6018, 1, '只有与宠物心意相通，才会发挥出它们全部的潜力，#Y莲花姑娘#n对此别有心得，你可以去向她请教。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (411, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (412, '莲花姑娘', 6019, 1, '宠物是我们最得力的伙伴，只有悉心的照料才能发挥出它们的全部潜力。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (413, '莲花姑娘', 6019, 1, '另外，还要多派遣它战斗，这样你们才更有默契，心有灵犀。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (414, '傅天涯阁', 6001, 1, '我明白了莲花姑娘，真是帮了大忙了！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (415, '莲花姑娘', 6019, 1, '#Y赵老板#n好像遇到了麻烦，可我有事脱不了身，如果公子能帮到他，那就太好了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (416, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (417, '傅天涯阁', 6001, 1, '赵老板，你遇到了什么麻烦么？', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (418, '赵老板', 6016, 1, '#Y张老板#n将祖传的玉佩借我赏玩，我却将它不慎落在了揽仙镇外的小路上，回去寻时却找不到了，那里动物颇多，可能被它们叼走了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (419, '傅天涯阁', 6001, 1, '包在我身上！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (420, '赵老板', 6016, 1, '若是找到了，就请直接送还张老板吧，我已经没脸去见他咯。#15m', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (421, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (422, '傅天涯阁', 6001, 1, '功夫不负有心人，可算是找到了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (423, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (424, '傅天涯阁', 6001, 1, '张老板，丢失的玉佩我已经找到了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (425, '张老板', 6012, 1, '谢天谢地，这下我可安心了！', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '4294967295');
INSERT INTO `npc_dialogue` VALUES (426, '傅天涯阁', 6001, 1, '我还要去告知赵老板玉佩找到的事，先告辞了。', 0, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue` VALUES (427, '傅天涯阁', 0, 0, '', 1, NULL, 20, '主线—浮生若梦', '2019-07-15 22:01:24', '2019-07-15 22:01:24', 0, '98066');
INSERT INTO `npc_dialogue_frame` VALUES (57, NULL, NULL, '自上古以后，天下分为十洲三岛，神仙、道友散居各处。[【主线】多谢道长救命之恩\\/主线—浮生若梦_s1][离开\\/离开]', NULL, '多闻道人', NULL, NULL, NULL, 0, NULL, NULL, '#R装备武器#n#@|BagDlg=%s#@', '1', '自上古以后，天下分为十洲三岛，神仙、道友散居各处。[离开\\/离开]', '1级装备', 1000000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (58, NULL, NULL, '#R装备武器#n#@|BagDlg=%s#@', NULL, '多闻道人', NULL, NULL, NULL, 0, NULL, NULL, '本店价格公道，药品齐备，全部采自深山，经过精炼而成，品质高，口味好，居家旅行，降妖伏魔都用得着哦！[买卖][【主线】道长命我来取药\\/主线—浮生若梦_s3][离开\\/离开]', '2', '111', '11', 1000000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (59, NULL, NULL, '本店价格公道，药品齐备，全部采自深山，经过精炼而成，品质高，口味好，居家旅行，降妖伏魔都用得着哦！[买卖][【主线】道长命我来取药\\/主线—浮生若梦_s3][离开\\/离开]', NULL, '王老板', NULL, NULL, NULL, 0, NULL, NULL, '我很喜欢收集那些可爱的小动物。[【主线】黄仨儿的宠物\\/主线—浮生若梦_s4][离开\\/离开]', '3', '本店价格公道，药品齐备，全部采自深山，经过精炼而成，品质高，口味好，居家旅行，降妖伏魔都用得着哦！[离开\\/离开]', '血池1个灵池1个(使用后多300000的储备)', 1000000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (60, NULL, NULL, '我很喜欢收集那些可爱的小动物。[【主线】黄仨儿的宠物\\/主线—浮生若梦_s4][离开\\/离开]', NULL, '黄仨儿', NULL, NULL, NULL, 0, NULL, NULL, '我很喜欢收集那些可爱的小动物。[【主线】与宠物并肩作战\\/主线—浮生若梦_s5][离开\\/离开]', '4', '我很喜欢收集那些可爱的小动物。[离开\\/离开]', '任务松鼠领取松鼠会拿到130的经验', 1000000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (61, NULL, NULL, '我很喜欢收集那些可爱的小动物。[【主线】与宠物并肩作战\\/主线—浮生若梦_s5][离开\\/离开]', NULL, '黄仨儿', NULL, NULL, NULL, 0, NULL, NULL, '常听人说起这世间美景，小女子也想外出游历一番，为了不耽误医治宠物，特有劳#Y杂货店老板#n代为出售#R驯兽诀#n，诸位大可移步前去。[【主线】如何与宠物心意相通\\/主线—浮生若梦_s6][离开\\/离开]', '5', '我很喜欢收集那些可爱的小动物。[离开\\/离开]', '松鼠270经验', 100000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (62, NULL, NULL, '常听人说起这世间美景，小女子也想外出游历一番，为了不耽误医治宠物，特有劳#Y杂货店老板#n代为出售#R驯兽诀#n，诸位大可移步前去。[【主线】如何与宠物心意相通\\/主线—浮生若梦_s6][离开\\/离开]', NULL, '莲花姑娘', NULL, NULL, NULL, 0, NULL, NULL, '承蒙大家关照，最近生意还算不错！客官需要住店吗？[【主线】我能帮你吗\\/主线—浮生若梦_s7][暂不需要\\/离开]', '6', '常听人说起这世间美景，小女子也想外出游历一番，为了不耽误医治宠物，特有劳#Y杂货店老板#n代为出售#R驯兽诀#n，诸位大可移步前去。[离开\\/离开]', '松鼠180经验', 100000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (63, NULL, NULL, '承蒙大家关照，最近生意还算不错！客官需要住店吗？[【主线】我能帮你吗\\/主线—浮生若梦_s7][暂不需要\\/离开]', NULL, '赵老板', NULL, NULL, NULL, 0, NULL, NULL, '去#Z揽仙镇外|揽仙镇外(41,32)|$1#Z寻找玉佩', '7', '承蒙大家关照，最近生意还算不错！客官需要住店吗？[暂不需要/离开]', '松鼠180经验', 100000000, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (64, NULL, NULL, '去#Z揽仙镇外|揽仙镇外(41,32)|$1#Z寻找玉佩', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, '整个揽仙镇上，就数我的武器最精良、最便宜了，行走江湖，应该人手一把。[【主线】丢失的玉佩已找到\\/主线—浮生若梦_s9][离开\\/离开]', '8', NULL, '松鼠450经验', 100000000, 20000);
INSERT INTO `npc_dialogue_frame` VALUES (65, NULL, NULL, '整个揽仙镇上，就数我的武器最精良、最便宜了，行走江湖，应该人手一把。[【主线】丢失的玉佩已找到\\/主线—浮生若梦_s9][离开\\/离开]', NULL, '张老板', NULL, NULL, NULL, 0, NULL, NULL, '承蒙大家关照，最近生意还算不错！客官需要住店吗？[【主线】玉佩已物归原主\\/主线—浮生若梦_s10][暂不需要\\/离开]', '9', '整个揽仙镇上，就数我的武器最精良、最便宜了，行走江湖，应该人手一把。[离开\\/离开]', '松鼠210经验', 420, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (66, NULL, NULL, '承蒙大家关照，最近生意还算不错！客官需要住店吗？[【主线】玉佩已物归原主\\/主线—浮生若梦_s10][暂不需要\\/离开]', NULL, '赵老板', NULL, NULL, NULL, 0, NULL, NULL, '常听人说起这世间美景，小女子也想外出游历一番，为了不耽误医治宠物，特有劳#Y杂货店老板#n代为出售#R驯兽诀#n，诸位大可移步前去。[【主线】莲花姑娘你找我\\/主线—浮生若梦_s11][离开\\/离开]', '10', '承蒙大家关照，最近生意还算不错！客官需要住店吗？[暂不需要/离开]', '松鼠休息后不再获得经验', 420, NULL);
