INSERT INTO `npc_dialogue_frame` VALUES (108, NULL, NULL, NULL, NULL, '杜卜思', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '本店价格公道，药品齐备，全部采自深山，经过精炼而成，品质高，口味好，居家旅行，降妖伏魔都用得着哦！[买卖][离开/离开]', NULL, NULL, NULL);
