INSERT INTO `npc_dialogue_frame` VALUES (111, NULL, NULL, NULL, NULL, '贾仁和', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '本店布料优质，做工精美，城里有头有脸的大爷们都从我这里买衣服。[时装性别更换/时装裁剪][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (112, NULL, NULL, NULL, NULL, '周华健', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '朋友一生一起走，一声朋友你会懂。[#R1000#n积分(6速+所有相性5玉佩)/1000积分][#R3000#n积分(神兽+所有相性5项链)/3000积分][#R5000#n积分(8速+所有相性5手镯)/5000积分][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (113, NULL, NULL, NULL, NULL, '妙音仙子', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '此生仅有一愿，聆尽世间天籁之音。[历届好声音排名][离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (114, NULL, NULL, NULL, NULL, '董老头', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '我年事已高，幸好身边有这些阿猫阿狗的陪伴才使我的晚年生活多了许多乐趣。[我要购买野生宠物][离开/离开]', NULL, NULL, NULL);
