INSERT INTO `npc_dialogue_frame` VALUES (116, NULL, NULL, NULL, NULL, '活动大使', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '中洲大陆的活动在此尽收眼底，欢迎各路豪杰前来参加！[【暑假】神秘数字/summer_day_2019_smsz_s0][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (117, NULL, NULL, NULL, NULL, '钱大富', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '本钱庄信誉优良、资金雄厚、通存通兑！[仓库][商贾货站/menu_trading_spot_open_dlg][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (118, NULL, NULL, NULL, NULL, '百晓通', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '所谓天外有天，中洲大陆高手如云！你可有兴趣一睹这些奇人异事、神兵利器的风采？[我要查看排行榜][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (119, NULL, NULL, NULL, NULL, '冯喜来', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '承蒙大家照顾，最近生意还算不错！[我想盘下一家客栈/inn_menu_create][关于客栈/inn_menu_introduce][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (120, NULL, NULL, NULL, NULL, '灵兽异人2', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '哎呀，最近鄙人乔迁新居，实在是忙不过来了，无奈只好托付#Y杂货店老板#n代为出售#R驯兽诀#n，想要医治宠物的道长大可移步前去，质量绝对有保证！[挑战灵宠幻境/send_stage_info][【武学历练】领取任务/try_create_task][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (121, NULL, NULL, NULL, NULL, '白邦芒', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '天墉城里的百姓有了麻烦事都爱找我帮忙，忙不过来啊，你能来帮帮忙吗？[【领取】助人为乐/助人为乐_s0][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (123, NULL, NULL, NULL, NULL, '神算子', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '灵验无比的先天演卦！能察阴阳祸福，可知过去未来！[请给我算上一卦/menu_divine][南荒巫术][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (124, NULL, NULL, NULL, NULL, '神算子', NULL, '2019-08-06 17:18:08', NULL, 0, '2019-08-06 17:18:08', NULL, NULL, NULL, '灵验无比的先天演卦！能察阴阳祸福，可知过去未来！[请给我算上一卦/menu_divine][南荒巫术][离开/离开]', NULL, NULL, NULL);
