INSERT INTO `npc_dialogue_frame` VALUES (143, NULL, NULL, NULL, NULL, '无名杂货店老板', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '本杂货铺信誉佳，南来北往的客人都喜欢在这带点东西。[我要做买卖][我要买驱魔香][离开\\/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (144, NULL, NULL, NULL, NULL, '玉真子', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '贫道有千兽图，内有无穷精怪。另有骑乘术，可将精怪去除野性，用来骑乘。[召唤精怪][驯化精怪][离开/离开]', NULL, NULL, NULL);
