INSERT INTO `npc_dialogue_frame` VALUES (146, NULL, NULL, NULL, NULL, '仙界神捕', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '乱世出英雄，眼下就有这样的机会，你可愿意？[领取悬赏任务/领取悬赏任务][我想领取悬赏经验/我想领取悬赏经验][我想领取悬赏道行/我想领取悬赏道行][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (147, NULL, NULL, NULL, NULL, '柳如尘', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '天道漫漫，修行之人应稳固仙基，莫使心魔乱其修行。今有玉虚真人命众灵神指点诸位修行之根本，特命我在此恭候。[【修行】我这就去/修行_s0][便捷组队/quick_match][我只是随便逛逛的/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (148, NULL, NULL, NULL, NULL, '玉泉真人', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '天法道、道法自然，此乃道义根本。十位上古仙神演自然玄机，终成十绝之阵。[【十绝阵】我欲挑战十绝阵/十绝阵_s0][便捷组队/quick_match][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (149, NULL, NULL, NULL, NULL, '陆压真人', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '贫道云游四方，近日夜观星象得知中洲大陆有妖邪作乱。贫道苦于繁事缠身，故在此等候能人异士代我前去伏魔除秽。不知仙友可有此意？[【伏魔】我这就去/领取任务][便捷组队/quick_match][我才懒得管/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (150, NULL, NULL, NULL, NULL, '清微真人', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '传说当年周公以八卦之理推演八卦图，今由#Y青龙#n、#Y白虎#n、#Y朱雀#n、#Y玄武#n四圣看守。[【飞仙渡邪】我这就去/飞仙渡邪_dispatch][便捷组队/飞仙渡邪_quick_match_team][离开/离开]', NULL, NULL, NULL);
INSERT INTO `npc_dialogue_frame` VALUES (151, NULL, NULL, NULL, NULL, '灵兽异人', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '哎呀，最近鄙人乔迁新居，实在是忙不过来了，无奈只好托付#Y杂货店老板#n代为出售#R驯兽诀#n，想要医治宠物的道长大可移步前去，质量绝对有保证！[参加斗宠大会/join_douchong_dahui][领取斗宠奖励/fetch_douchong_dahui_bonus][离开/离开]\n', NULL, NULL, NULL);
