INSERT INTO `show_tasks` VALUES (NULL, 17, '1-9级主线任务，该等级段任务不可组队同步完成。\n此行最重要的事可别忘了，前往#R五龙山#n拜师！', '前往#Z五龙山#Z拜师', 0, 1563030570, 0, '#I经验|人物经验宠物经验#I#I代金券|代金券#I', '主线—浮生若梦', '', 12, '2019-07-16 15:51:05', '2019-07-16 15:51:05', 0);
